  true,\n\t\"url\": null,\n\t\"notes\": \"The Real Property Project Tracking System
  (RPPTS), formerly known as the Lease/Project Tracking (LEASE) database, contains
  information about lease and land projects that are handled by the Office of Construction
  & Facilities Management. Through a delegation of leasing authority from General
  Services Administration (GSA), VA directly leases its space. Information collected
  includes type of space, type of lease, proposed space dimensions and budget, type
  of land acquisition, brief description of the project, acquisition milestone dates,
  and project manager's contact information. The information is provided and entered
  in by the responsible project manager. RPPTS was developed by the VA Headquarters
  Automation Center in collaboration with Real Property Management Service to provide
  on-line access to information concerning VA's direct leasing projects.\",\n\t\"license_title\":
